import { Container, Grid } from "@mui/material";
import React from "react";
import Box from "@mui/material/Box";
import Story from "./Story";

function Feed() {
  return (
    <div>
      <Container maxWidth="sm">
        <Box
          sx={{
            width: 600,
            height: 350,
          }}
        >
          <Story sx={{ marginTop: "80px" }} />
        </Box>
        <Box  sx={{
          width: 450,
          height: 60,
            textAlign: "center",
            background: "white",
            border: "1px solid black",
            margin: 4,
            marginTop: "0%"
          }} >
        

         
        </Box>
        
     
      </Container>
    
    </div>
  );
}

export default Feed;
